sys_variable_value.value:
(function execute(inputs, outputs) {

    var value=inputs.response;

    var policykey = value.Envelope.Body.M_PARTNER_APPTRACKER_NEWResponse.M_PARTNER_APPTRACKER_NEWResponseElement[0].POLICYKEY;
    var issuedate = value.Envelope.Body.M_PARTNER_APPTRACKER_NEWResponse.M_PARTNER_APPTRACKER_NEWResponseElement[0].EFFDATE;

    var gdt = new GlideDateTime(issuedate);
    var formattedDate = gdt.getDate();
    
   outputs.pkey=policykey;
   outputs.issuedate=formattedDate;

    
// ... code ...
})(inputs, outputs);

